class MainActivity : AppCompatActivity() {
    private val CAMERA_PERMISSION_REQUEST_CODE = 1000
    private val CAMERA_REQUEST_CODE = 10001

    override fun onCreate(savedInstanceState: Bundle?) {
        super.onCreate(savedInstanceState)
        setContentView(R.layout.activity_main)
        if (!Python.isStarted()){
            Python.start(AndroidPlatform(this))
        }
        var increment = 0
        val textView = findViewById<TextView>(R.id.textView)
        val btnTakePicture = findViewById<Button>(R.id.btnTakePicture)
        val btnTrain = findViewById<Button>(R.id.btnTrain)
        val imageView = findViewById<ImageView>(R.id.imageView)
        val python = Python.getInstance()
        val pythonFile = python.getModule("naieveBayes")
        btnTrain.setOnClickListener {
            pythonFile.callAttr("trainModel")
            btnTakePicture.visibility= View.VISIBLE
            btnTrain.visibility= View.GONE
            textView.visibility= View.VISIBLE
            textView.text = "Ready To Take Picture"
        }

        btnTakePicture.setOnClickListener {
//            val s = pythonFile.callAttr("testPython").toString()
//            textView.text= """$s$increment"""
//            increment += 1
            textView.visibility= View.VISIBLE
            //val prediction = pythonFile.callAttr("testImage", 2)
            //textView.text = "The Number in your image is $prediction"

                if (hasPermission()) {
                    openCamera()
                } else {
                    requestPermission()
                }

        }

    }
    open fun openCamera() {
        val cameraIntent = Intent(MediaStore.ACTION_IMAGE_CAPTURE)
        startActivityForResult(cameraIntent, CAMERA_REQUEST_CODE)
    }

    private fun hasPermission(): Boolean {
        return if (VERSION.SDK_INT >= Build.VERSION_CODES.N) {
            checkSelfPermission(Manifest.permission.CAMERA) == PackageManager.PERMISSION_GRANTED
        } else true
    }

    private fun requestPermission() {
        if (VERSION.SDK_INT >= Build.VERSION_CODES.N) {
            if (shouldShowRequestPermissionRationale(Manifest.permission.CAMERA)) {
                Toast.makeText(this, "Camera Permission Required", Toast.LENGTH_SHORT).show()
            }
            requestPermissions(
                arrayOf(Manifest.permission.CAMERA),
                CAMERA_PERMISSION_REQUEST_CODE
            )
        }
    }

    override fun onRequestPermissionsResult(
        requestCode: Int,
        permissions: Array<String?>,
        grantResults: IntArray
    ) {
        super.onRequestPermissionsResult(requestCode, permissions, grantResults)
        if (requestCode == CAMERA_PERMISSION_REQUEST_CODE) {
            if (hasAllPermissions(grantResults)) {
                openCamera()
            } else {
                requestPermission()
            }
        }
    }

    private fun hasAllPermissions(grantResults: IntArray): Boolean {
        for (result in grantResults) {
            if (result == PackageManager.PERMISSION_DENIED) return false
        }
        return true
    }

    @RequiresApi(Build.VERSION_CODES.KITKAT)
    override fun onActivityResult(
        requestCode: Int,
        resultCode: Int,
        data: Intent?
    ) {
        if (requestCode == CAMERA_REQUEST_CODE) {
            val python = Python.getInstance()
            val pythonFile = python.getModule("naieveBayes")
            val textView = findViewById<TextView>(R.id.textView)
            val imageView = findViewById<ImageView>(R.id.imageView)
            val photo : Bitmap?= data?.extras?.get("data") as Bitmap?
            imageView.setImageBitmap(photo)
            val stream = ByteArrayOutputStream()
            photo?.compress(Bitmap.CompressFormat.JPEG, 100, stream)
            val imageBytes: ByteArray = stream.toByteArray()
            val imageString: String = Base64.encodeToString(imageBytes, Base64.DEFAULT)
//            photo?.compress(Bitmap.CompressFormat.PNG, 90, stream)
//            val image = stream.toByteArray()
//            val base64Encoded = String(image, StandardCharsets.UTF_8)
//            val base64Encoded = ""
//            val byteArrayOutputStream =
//                ByteArrayOutputStream()
//            bitmap.compress(Bitmap.CompressFormat.PNG, 100, byteArrayOutputStream)
//            val byteArray = byteArrayOutputStream.toByteArray()
            val prediction = pythonFile.callAttr("testImage", imageString, 2)
            textView.text = "The number in your image is $prediction"
//            photo?.let { photo->  val prediction = pythonFile.callAttr("testImage", photo, 2)
//                textView.text = "The number in your image is $prediction"
//            }
        }
        super.onActivityResult(requestCode, resultCode, data)
    }
}